package main 

import (
	"fmt"
	"math/big"
	"math/rand"
	"time"
	)

func main() {
	now := time.Now();

	seed := now.Nanosecond();

	source := rand.NewSource(int64(seed));

	random := rand.New(source);

	bigint,_ := big.NewInt(0).SetString("",10);

	properSize,_ := big.NewInt(0).SetString("",10);

	atLeast,_ := big.NewInt(0).SetString("",10);

	bigint.Rand(random, properSize);

	for i := 0; !bigint.ProbablyPrime(100); i++ {
		if i % 100 == 0 {
			fmt.Printf("i = %d\n", i);
		}
		bigint.Rand(random, properSize);
		for j := 0; bigint.Cmp(atLeast) <= 0; j++ {
			fmt.Printf("j = %d\n", j);
			fmt.Println(bigint);
			bigint.Rand(random, properSize);
		}
	}

	fmt.Println(bigint.ProbablyPrime(1000));

	fmt.Println(bigint);
}